(20, 'ar', 'الأحكام والشروط', 'أين يمكنني الحصول على بعض؟<br />\r\nهناك العديد من أشكال مقاطع Lorem Ipsum المتاحة ، لكن الغالبية عانوا من التغيير في شكل ما ، عن طريق الفكاهة المحقونة ، أو الكلمات العشوائية التي لا تبدو حتى معقولة بعض الشيء. إذا كنت ستستخدم مقطعًا من Lorem Ipsum ، فأنت بحاجة إلى التأكد من عدم وجود أي شيء محرج مخفي في منتصف النص. تميل جميع مولدات Lorem Ipsum على الإنترنت إلى تكرار الأجزاء المحددة مسبقًا حسب الضرورة ، مما يجعلها أول مولد حقيقي على الإنترنت. يستخدم قاموسًا يضم أكثر من 200 كلمة لاتينية ، بالإضافة إلى حفنة من هياكل الجملة النموذجية ، لإنشاء Lorem Ipsum الذي يبدو معقولًا. لذلك فإن أبجد أبجد هوز هو دائما خالية من التكرار ، والفكاهة عن طريق الحقن ، أو الكلمات غير المميزة الخ<br />\r\n<br />\r\nحيث أنها لا تأتي من؟<br />\r\nخلافًا للاعتقاد السائد ، فإن Lorem Ipsum ليس مجرد نص عشوائي. لها جذور في قطعة من الأدب اللاتيني الكلاسيكي من 45 قبل الميلاد ، مما يجعلها أكثر من 2000 سنة. بحث ريتشارد مكلينتوك ، وهو أستاذ لاتيني في كلية هامبدن سيدني في فرجينيا ، عن واحدة من أكثر الكلمات اللاتينية غموضًا ، كونسيتيتور ، من ممر لوريم إبسوم ، ومضىًّا باستشهاد الكلمة في الأدب الكلاسيكي ، اكتشف المصدر الذي لا شك فيه. يأتي Lorem Ipsum من القسمين 1.10.32 و 1.10.33 من كتاب &quot;Finibus Bonorum et Malorum&quot; (قصور الخير والشر) للكاتب شيشرون ، الذي كتب عام 45 قبل الميلاد. هذا الكتاب هو أطروحة عن نظرية الأخلاق ، وشعبية للغاية خلال عصر النهضة. يأتي السطر الأول من Lorem Ipsum ، &quot;Lorem ipsum dolor sit amet ..&quot; ، من سطر في القسم 1.10.32.<br />\r\n<br />\r\nالجزء المعياري من Lorem Ipsum المستخدم منذ القرن الخامس عشر الميلادي مستنسخ أدناه للمهتمين. يتم أيضًا استنساخ المادتين 1.10.32 و 1.10.33 من &quot;Finibus Bonorum et Malorum&quot; من Cicero في شكلها الأصلي بالضبط ، مصحوبة بنسخ إنجليزية من الترجمة 1914 التي كتبها H. Rackham.<br />\r\n<br />\r\n<br />\r\nما هو أبجد هوز؟<br />\r\nأبجد هوز هو مجرد دمية النص لصناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في هذه الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من نوعه وتدافعت عليه لصنع كتاب نموذج للعينات. لقد نجا ليس فقط خمسة قرون ، ولكن أيضا قفزة في التنضيد الإلكتروني ، تبقى دون تغيير أساسي. تم الترويج لها في الستينيات من القرن الماضي من خلال إصدار أوراق Letraset التي تحتوي على مقاطع Lorem Ipsum ، ومؤخراً مع برنامج النشر المكتبي مثل Aldus PageMaker بما في ذلك إصدارات Lorem Ipsum.', '2020-02-12 08:55:22.477007', '2020-02-12 08:55:22.477021', 9),
(21, 'es', 'Términos y Condiciones', '&iquest;D&oacute;nde puedo conseguir algunas?<br />\r\nHay muchas variaciones de pasajes de Lorem Ipsum disponibles, pero la mayor&iacute;a ha sufrido alteraci&oacute;n de alguna forma, por humor inyectado o palabras aleatorias que no parecen ni siquiera un poco cre&iacute;bles. Si va a utilizar un pasaje de Lorem Ipsum, debe asegurarse de que no haya nada vergonzoso oculto en medio del texto. Todos los generadores Lorem Ipsum en Internet tienden a repetir fragmentos predefinidos seg&uacute;n sea necesario, lo que lo convierte en el primer generador verdadero en Internet. Utiliza un diccionario de m&aacute;s de 200 palabras latinas, combinado con un pu&ntilde;ado de estructuras de oraciones modelo, para generar Lorem Ipsum que parece razonable. Por lo tanto, el Lorem Ipsum generado siempre est&aacute; libre de repeticiones, humor inyectado o palabras no caracter&iacute;sticas, etc.<br />\r\n<br />\r\n&iquest;De d&oacute;nde viene?<br />\r\nContrariamente a la creencia popular, Lorem Ipsum no es simplemente un texto aleatorio. Tiene ra&iacute;ces en una pieza de literatura latina cl&aacute;sica del 45 a. C., con m&aacute;s de 2000 a&ntilde;os de antig&uuml;edad. Richard McClintock, profesor de lat&iacute;n del Hampden-Sydney College en Virginia, busc&oacute; una de las palabras latinas m&aacute;s oscuras, consectetur, de un pasaje de Lorem Ipsum, y al revisar las citas de la palabra en la literatura cl&aacute;sica, descubri&oacute; la fuente indudable. Lorem Ipsum proviene de las secciones 1.10.32 y 1.10.33 de &quot;de Finibus Bonorum et Malorum&quot; (Los extremos del bien y del mal) de Cicero, escrito en 45 a. Este libro es un tratado sobre la teor&iacute;a de la &eacute;tica, muy popular durante el Renacimiento. La primera l&iacute;nea de Lorem Ipsum, &quot;Lorem ipsum dolor sit amet ..&quot;, proviene de una l&iacute;nea en la secci&oacute;n 1.10.32.<br />\r\n<br />\r\nEl fragmento est&aacute;ndar de Lorem Ipsum utilizado desde el a&ntilde;o 1500 se reproduce a continuaci&oacute;n para los interesados. Las secciones 1.10.32 y 1.10.33 de &quot;de Finibus Bonorum et Malorum&quot; de Cicero tambi&eacute;n se reproducen en su forma original exacta, acompa&ntilde;adas de versiones en ingl&eacute;s de la traducci&oacute;n de 1914 de H. Rackham.<br />\r\n<br />\r\n<br />\r\n&iquest;Qu&eacute; es Lorem Ipsum?<br />\r\nLorem Ipsum es simplemente un texto ficticio de la industria de impresi&oacute;n y composici&oacute;n tipogr&aacute;fica. Lorem Ipsum ha sido el texto ficticio est&aacute;ndar de la industria desde el a&ntilde;o 1500, cuando una impresora desconocida tom&oacute; una galera de tipo y la mezcl&oacute; para hacer un libro de muestras. Ha sobrevivido no solo cinco siglos, sino tambi&eacute;n el salto a la composici&oacute;n electr&oacute;nica, permaneciendo esencialmente sin cambios. Se populariz&oacute; en la d&eacute;cada de 1960 con el lanzamiento de las hojas de Letraset que contienen pasajes de Lorem Ipsum, y m&aacute;s recientemente con software de publicaci&oacute;n de escritorio como Aldus PageMaker que incluye versiones de Lorem Ipsum.', '2020-02-12 08:55:22.517562', '2020-02-12 08:55:22.517570', 9),
(22, 'en', 'Privacy Policy', 'Why do we use it?<br />\r\nIt is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).<br />\r\n<br />\r\nWhere does it come from?<br />\r\nContrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of &quot;de Finibus Bonorum et Malorum&quot; (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, &quot;Lorem ipsum dolor sit amet..&quot;, comes from a line in section 1.10.32.', '2020-02-12 09:06:20.922892', '2020-02-12 09:06:20.922900', 10),
