INSERT INTO `email_templates` (`id`, `name`, `subject`, `body`, `is_active`, `created_at`, `updated_at`, `action`) VALUES
(1, 'Email verification after Registration', '[TFH] Confirm Your Registration', '<p>Welcome to TFH!<br />\r\n<br />\r\nClick the button below to complete verification:</p>\r\n&nbsp;\r\n\r\n<p><a href=\"{URL}\" style=\"color:#fff; background-color:#059be1; text-decoration: none; padding: 12px 18px; border-radius: 2px;\">Verify Email</a></p>\r\n\r\n<p>If you can&#39;t confirm by clicking the button above, please copy the URL below into your browser address bar to verify your email address.<br />\r\n{URL}</p>\r\n&nbsp;\r\n\r\n<p><br />\r\nBest regards,</p>\r\n\r\n<p>TFH Team</p>\r\n', 1, '2019-09-21 07:41:19.770731', '2019-09-21 07:41:19.770738', 'account_verification'),
(2, 'New user registration', 'Registration Information', '<h3><em>Dear {USER_NAME},</em></h3>\r\n<em>Greeetings of the Day..<br />\r\n<br />\r\nWe wanted to let you know that you are now registered with Website<br />\r\n<br />\r\nYour Email address is &quot;<strong>{EMAIL}</strong>&quot;<br />\r\nAnd&nbsp; password is &quot;<strong>{PASSWORD}</strong>&quot;.<br />\r\n<br />\r\nPlease follow the link and login with your email address and password.</em>\r\n\r\n<p><em><strong><a href=\"{LOGIN_LINK}\">Click here</a></strong><br />\r\n<br />\r\nOR<br />\r\n<br />\r\nCopy below URL in your browser.<br />\r\n<strong>{LINK}</strong></em></p>\r\n\r\n<p><em><strong>Thanks</strong></em></p>\r\n', 1, '2019-09-21 07:44:22.875341', '2019-09-21 07:44:22.875348', 'user_registration'),
(3, 'Registration Temporary Details', 'Registration Temporary Details', '<h3><em>Dear {USER_NAME},</em></h3>\r\n<em>Greeetings of the Day..<br />\r\n<br />\r\nWe wanted to let you know that you are now registered with Website<br />\r\n<br />\r\nYour Email address is &quot;<strong>{EMAIL}</strong>&quot;<br />\r\nAnd&nbsp; password is &quot;<strong>{PASSWORD}</strong>&quot;.<br />\r\n<br />\r\nPlease follow the link and login with your email address and password.</em>\r\n\r\n<p><em><strong><a href=\"{LOGIN_LINK}\">Click here</a></strong><br />\r\n<br />\r\nOR<br />\r\n<br />\r\nCopy below URL in your browser.<br />\r\n<strong>{LINK}</strong></em></p>\r\n\r\n<p><em><strong>Thanks</strong></em></p>\r\n', 1, '2019-09-21 07:44:22.875341', '2019-09-21 07:44:22.875348', 'user_temporary_details'),
(4, 'tip received', 'Tip Received', 'Hi {USER_NAME},<br />\r\n{MODEL_NAME}&nbsp;Send you tip {CURRENCY} {AMOUNT}<br />\r\nThanks', 1, '2020-01-02 11:20:04.972881', '2020-01-02 11:20:04.972890', 'tip_received_notification'),
(5, 'model subscription plan purchase', 'Subscription Plan Purchased', '<span style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51); font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px\">Hi {MODEL_NAME},</span><br />\r\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51); font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px\">{USER_NAME} has purchased plan for {ACCOUNT} with cost {CURRENCY} {AMOUNT}</span><br />\r\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51); font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px\">Thank You</span>', 1, '2020-01-02 13:41:25.287814', '2020-01-02 13:41:25.287821', 'model_subscription_plan_purchase'),
(9, 'user plan expire', 'Plan Expires Today', 'Hi&nbsp;{MODEL_NAME}<br />\r\nyour&nbsp;{ACCOUNT} subscription plan for model&nbsp;{USER_NAME}&nbsp;costing&nbsp;{CURRENCY}&nbsp;{AMOUNT} is expiring todday!<br />\r\nThanks', 1, '2020-01-03 07:57:11.420181', '2020-01-03 07:57:11.420192', 'model_subscription_plan_expires_user'),
(10, 'model plan expires', 'Plan Expires Today', 'Hi&nbsp;{USER_NAME},&nbsp;<br />\r\n{MODEL_NAME}&nbsp;{ACCOUNT} subscription plan costing&nbsp;{CURRENCY}&nbsp;{AMOUNT} is expiring today!<br />\r\nThanks', 1, '2020-01-03 08:02:02.157988', '2020-01-03 08:02:02.157996', 'model_subscription_plan_expires_model'),
(11, 'user unsuccessful login', 'Unsuccessful Account Login', 'Hi&nbsp;{EMAIL},<br />\r\nyour TFH account has been unsuccessfully login by I.P. {IP_ADDRESS} with the information&nbsp;{USER_AGENT}.<br />\r\nThank You', 1, '2020-01-20 09:24:50.066546', '2020-01-20 09:24:50.066553', 'unsuccessful_login_notification'),
(12, 'unauthorized device sign in', 'New device signed in to', 'Hi&nbsp;{EMAIL}<br />\r\nYour TFH Account was just signed in to from a new device. You are getting this email to make sure it was you with an I.P. {IP_ADDRESS} and browser&nbsp;{BROWSER} with the information&nbsp;{USER_AGENT}<br />\r\nThank You', 1, '2020-01-20 10:34:49.488631', '2020-01-20 10:34:49.488639', 'login_on_unverified_device_notification'),
(13, 'Model Snapchat Username Changed', 'Model Snapchat Username Changed', 'Hi&nbsp;{EMAIL},<br />\r\nTFH model&nbsp;{USERNAME} has changed its snapchat username to&nbsp;{SNAPCHATUSERNAME}&nbsp;<br />\r\nThank You', 1, '2020-01-20 13:14:52.415401', '2020-01-20 13:14:52.415422', 'model_snapchat_username_changed'),
(14, 'Subscriber Subscription Plan Purchase', 'Subscription Plan Purchased', '<span style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51); font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px\">Hi&nbsp;{USER_NAME},</span><br />\r\n<br />\r\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51); font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px\">You have purchased plan for&nbsp;{ACCOUNT} from&nbsp;</span>{MODEL_NAME}<span style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51); font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px\"> model which is costing {CURRENCY} {AMOUNT}</span><br />\r\n<br />\r\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(51, 51, 51); font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px\">Thank You</span>', 1, '2020-01-30 05:31:36.007053', '2020-01-30 05:31:36.007060', 'subscriber_subscription_plan_purchase'),
(15, 'Email Forgot Password', '[TFH] Forgot password', '<p>Welcome to TFH!<br />\r\n<br />\r\nClick the button below to complete verification:</p>\r\n&nbsp;\r\n\r\n<p><a href=\"{URL}\" style=\"color:#fff; background-color:#059be1; text-decoration: none; padding: 12px 18px; border-radius: 2px;\">Reset Password</a></p>\r\n\r\n<p>If you can&#39;t confirm by clicking the button above, please copy the URL below into your browser address bar to reset your password.<br />\r\n{URL}</p>\r\n&nbsp;\r\n\r\n<p><br />\r\nBest regards,</p>\r\n\r\n<p>TFH Team</p>\r\n', 1, '2020-02-03 05:06:30.650306', '2020-02-03 05:06:30.650319', 'forgot_password'),
(16, 'Unsubscribe Newsletter', 'Unsubscribe Newsletter', 'Hi&nbsp;{TO_EMAIL},<br />\r\n<br />\r\nYou have successfully subscribed to&nbsp;{WEBSITE_URL} .<br />\r\nYou can anytime unsubscribed by clicking on below link.<br />\r\n{UNSUBSCRIBE_LINK}<br />\r\n<br />\r\nThank You', 1, '2020-02-28 13:14:47.859741', '2020-02-28 13:14:47.859756', 'send_newsletter');
